let currentImage = 0;

const getNextSlide = () => {
    currentImage += 1;
    if (currentImage + 1 >= images.length) {//5
        currentImage = 0;
        document.querySelector('.image').src = images[currentImage];
        return
    }
    document.querySelector('.image').src = images[currentImage];


}
const getPrevSlide = () => {
    currentImage -= 1;
    if (currentImage - 1 < 0) {//-1
        currentImage = images.length; //5
        document.querySelector('.image').src = images[currentImage - 1];
        return
    }
    document.querySelector('.image').src = images[currentImage - 1];
}
const getSlide = (e) => {
    switch (e.target.dataset.button) {
        case 'prevImage':
            getPrevSlide()
            break;
        case 'nextImage':
            getPrevSlide()
            break;

        default:
            break;
    }
}

pict.addEventListener('click', getSlide)
